    );
    const ref = useRef(null);

    const initViz = () => {
      new tableau.Viz(ref.current, url);
    };

    useEffect(initViz, []);

    return (
      <div>
        {/* <h1>{props.location.state}</h1> */}
        <div ref={ref} />
      </div>
    );
  }


export default Dashboard1;
